import { Carousel } from "react-responsive-carousel";
import React from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const CarouselComponent = () => {
  return (
    <div>
      <Carousel
        showThumbs={false}
        autoPlay={true}
        infiniteLoop={true}
        dynamicHeight={true}
      >
        <div>
          <img src="../travel-lady-home-bg.jpg" style={{ height: "400px" }} />
          THE ADVENTURE YOU HAVE
        </div>
        <div>
          <img src="../home-bg.jpg" style={{ height: "400px" }} />
          <h1 className="legend">THE ADVENTURE YOU HAVE</h1>
        </div>
        <div>
          <img
            src="../travel-landscape-home-bg.jpg"
            style={{ height: "400px" }}
          />
          <h1 className="legend">THE ADVENTURE YOU HAVE</h1>
        </div>
      </Carousel>
    </div>
  );
};

export default CarouselComponent;
